import './App.css';
import { useState } from 'react';
import axios from 'axios'; // Import Axios library

function App() {
  const [formData, setFormData] = useState({
    // Initialize your form data here
  });

  // Function to handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('http://localhost:5000/nominee/create', formData); // Use Axios for POST request

      // Handle the response
      console.log('Nominee created:', response.data);
      // Optionally, you can perform further actions based on the response
    } catch (error) {
      console.error('Error creating nominee:', error);
    }
  };

  // Function to handle form input changes
  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  return (
    <div className="App">
      <form onSubmit={handleSubmit}>
        {/* Your form inputs go here */}
        <input type="text" name="name" placeholder="Nominee Name" onChange={handleChange} />
        <input type="text" name="email" placeholder="Nominee Email" onChange={handleChange} />
        {/* Add more inputs as needed */}

        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default App;
